DROP TABLE IF EXISTS movies;
DROP TABLE IF EXISTS tags;
DROP TABLE IF EXISTS ratings;
DROP TABLE IF EXISTS users;

CREATE TABLE movies(
        id INTEGER PRIMARY KEY AUTOINCREMENT,
        `title` TEXT,
        `year` DATE,
        `geners` TEXT
);

CREATE TABLE tags(
        id INTEGER PRIMARY KEY AUTOINCREMENT,
        `user_id` INTEGER NOT NULL,
        `movie_id` INTEGER NOT NULL,
        `tag` TEXT NOT NULL,
        `timestamp` TIMESTAMP 
);

CREATE TABLE ratings(
        id INTEGER PRIMARY KEY AUTOINCREMENT,
        `user_id` INTEGER,
        `movie_id` INTEGER,
        `rating` REAL,
        `timestamp` TIMESTAMP 
);

CREATE TABLE users(
        id INTEGER PRIMARY KEY AUTOINCREMENT,
        `name` TEXT NOT NULL,
        `email` TEXT NOT NULL,
        `gender` TEXT NOT NULL,
        `register_date` DATE,
        `occupation` TEXT
);





